var canvas = document.getElementById("canvas");
var ctx = canvas.getContext("2d");
var img = document.getElementById("img");
var wrp = document.getElementById("wrp");
var H = 300;
var wH = 450;
var thumbX = 150;
var thumbY = 150;
var imgW = 0;
var imgH = 0;
canvas.width = thumbX;
canvas.height = thumbY;
var srcW;
img.addEventListener("load", function(event) {

  var w = img.clientWidth;
  var h = img.clientHeight;
  srcW = w;
  var k = H / h;
  imgW = w * k;
  imgH = h * k;
  var wrpW = imgW * 1.5;
  var wrpH = wH;

  wrp.style.width = wrpW + "px";
  img.style.width = imgW + "px";
  img.style.left = (wrpW - imgW) / 2 + "px";
  img.style.top = (wrpH - imgH) / 2 + "px";
  updateThumb();
});
img.setAttribute("src", "data:image/png;base64,");
var dragging = false;
var prev
var event = 'onwheel' in document ? 'wheel' : 'onmousewheel' in document ? 'mousewheel' : 'DOMMouseScroll';

wrp.addEventListener(event, function(event) {
  event.preventDefault();
  var d = 5;
  if (event.deltaY < 0) {
    d = -5;
  }
  var r = imgH / imgW;
  imgW += d;
  imgH = imgW * r;
  img.style.width = imgW + "px";
  img.style.height = imgH + "px";
  updateThumb();

  console.log(event);
});
img.addEventListener("dragstart", function(event) {
  event.preventDefault();
});
var sX = 0;
var sY = 0;
document.getElementById("crop").addEventListener("mousedown", function(event) {
  sX = event.layerX;
  sY = event.layerY;
  dragging = true;
  img.style.left = (event.clientX - wrp.offsetLeft - imgW / 2) + "px";
  img.style.top = (event.clientY - wrp.offsetTop - H / 2) + "px";
  updateThumb();
});
document.addEventListener("mouseup", function(event) {

  dragging = false;
});
document.addEventListener("mousemove", function(event) {

  if (dragging) {
    img.style.left = (event.clientX - wrp.offsetLeft - imgW / 2) + "px";
    img.style.top = (event.clientY - wrp.offsetTop - H / 2) + "px";

    updateThumb();
  }
});

function updateThumb() {

  ctx.clearRect(0, 0, canvas.width, canvas.height);
  var z = srcW / img.width;
  var sx = (canvas.offsetLeft - img.offsetLeft - thumbX / 2) * z;
  var sy = (canvas.offsetTop - img.offsetTop - thumbY / 2) * z;

  ctx.drawImage(img, sx, sy, thumbX * z, thumbY * z, 0, 0, thumbX, thumbY);
}

function getData() {

  var dataURL = canvas.toDataURL("image/jpg");

  dataUrl = dataURL.replace(/^data:image\/(png|jpg);base64,/, "");

  var cropped = document.createElement("img");
  cropped.setAttribute("src", dataURL);
  document.body.prepend(cropped);
}